  return (
    <Fragment>

      <button className="btn btn-success" onClick={handleShwoService}>Agenda tu hora</button>
      {showService ? 
        <div className="row">
          <Service/>
          <Service/>
        </div> : <Fragment></Fragment>}


    </Fragment>
  );
}

